import sedans from '../images/icon-sedans.svg';
import suvs from '../images/icon-suvs.svg';
import luxury from '../images/icon-luxury.svg';

const pageData = [
  {
    name: 'sedans',
    icon: sedans,
    info: `Choose a sedan for its affordability               
            and excellent fuel economy. Ideal for              
            cruising in the city or on your next               
            road trip.`
  },
    {
    name: 'suvs',
    icon: suvs,
      info: `Take an SUV for its spacious interior,
              power, and versatility. Perfect for 
               your next family vacation and off-road             
               adventures.`
  },
      {
    name: 'luxury',
    icon: luxury,
        info: `Cruise in the best car brands without              
              the bloated prices. Enjoy the enhanced             
              comfort of a luxury rental and arrive              
              in style.`
  }
]

export default pageData;
